import './card.styles.css';
import cardImage from '../../assets/images/small-robot.png';

const Card = ({ projectName }) => {
  return (
    <div className="card">
      <img src="img_avatar.png" alt="Avatar" />
      <div class="container">
        <h4>
          <b>John Doe</b>
        </h4>
        <p>Architect & Engineer</p>
      </div>
    </div>
  );
};
export default Card;
